export function getRandomSpotifyTrackIds(numTracks: number) {
  const randomTracks = new Set<string>();
  while (randomTracks.size < numTracks) {
    const randomInd = Math.trunc(Math.random() * possibleTracks.length);
    randomTracks.add(possibleTracks[randomInd]);
  }
  return [...randomTracks];
}
